                                                                                                  "class drawableImageAt (location': Point)",
                                                                                                  "          size (dimensions': Point)",
                                                                                                  "          url (url: String)",
                                                                                                  "          on (canvas': DrawingCanvas) -> Graphic2D {",
                                                                                                  "        // Creates image from url and places on",
                                                                                                  "        // canvas' at location' with size width' x height'",
