                                                                                                  "        method text -> String {",
                                                                                                  "            // answer the text",
                                                                                                  "            self.element.value",
                                                                                                  "        }",
                                                                                                  "",
                                                                                                  "        method text:= (value: String) -> Done {",
                                                                                                  "            // Updates the text",
                                                                                                  "            self.element.value:= value",
                                                                                                  "        }",
                                                                                                  "",
                                                                                                  "        // Return string representation of the text field",
                                                                                                  "        method asString -> String {",
